import React from 'react';
import DataTable from 'react-data-table-component';
import axios from 'axios';
axios.defaults.withCredentials = true;

function HomeComp() {
    let data = [];
    axios.get("http://140.116.214.154:3000/api/home/first15")
        .then(res => {
            data = res;
        })

    const columns = [
        {
            name: '股票代號',
            selector: row => row.stockNum,
            sortable: true,
        },{
            name: '股票名稱',
            selector: row => row.stockName,
            sortable: true,
        },{
            name: '資料日期',
            selector: row => row.date,
            sortable: true,
        },{
            name: '提供者',
            selector: row => row.investmentCompany,
            sortable: true,
        },{
            name: '檔案下載',
            selector: row => row.download,
        },
    ];


    return (
        <div className = 'container-fluid'>
            <div className = 'col-md-8 offset-md-2'>

                <DataTable columns = { columns } />
            </div>
        </div>
    );
}

export default HomeComp;
